import './App.css';
import Home from './components/Home';
import Navbar from './components/Navbar';

function App() {

  return (
    <>
    <div style={{
      backgroundImage: `url("images/cute.jpg")`,
      backgroundSize: 'cover',
      height: '900px'
    }} >

      <Navbar/>
      <Home/>
    </div>
    </>
  );
}

export default App;
